import logo from './logo.svg';
import './App.css';
import Footer from "./layout/Footer";
import Header from './layout/Header';

function App() {
  return (
    <div className="wrap">
      <Header/>
      <img src="img/common/logo.png" alt="startto"/>
      <Footer/>
    </div>
  );
}

export default App;
